import React from "react";
import axios from "axios";
import { useState } from "react";

function Stock()
{
    const [names,Setname] = useState("")
    const [logos,Setlogo] = useState("")

    const FetchName = () =>
    {
        axios
        .get(`https://finnhub.io/api/v1/stock/profile2?symbol=AAPL&token=cjmeg19r01qmdd9puljgcjmeg19r01qmdd9pulk0`)

        .then((response) =>
        {
            const {name,logo} =response.data

             Setlogo(logo)
             Setname(name)
               
            
        })
    }

    
    

        return(
            <>
                
                        <h3>{names}</h3>
                        <button onClick={FetchName()}>Fetch</button>
        
                
            </>

        );
    
}


export default Stock;
